import { BrowserRouter, Route } from "react-router-dom";
import About from "./About";
import ContactUs from "./ContactUs";
import FAQ from "./FAQ";
import Footer from "./Footer";
import Form from "./Form";
import Header from "./Header";
import Hero from "./Hero";
import OurTeam from "./OurTeam";
import Services from "./Services";

function App() {
  return (
    <>
      <BrowserRouter>
        <Route path='/'>
          <Header />
          <Hero />
        </Route>
        <Route path='/About'>
          <About />
        </Route>
        <Route path='/Services'>
          <Services />
        </Route>
        <Route path='/OurTeam'>
          <OurTeam />
        </Route>
        <Route path='/FAQ'>
          <FAQ />
        </Route>
        <Route path='/Form'>
          <Form />
        </Route>
        <Route path='/ContactUs'>
          <ContactUs />
        </Route>
        <Route path='/Footer'>
          <Footer />
        </Route>
      </BrowserRouter>
    </>
  );
}

export default App;
